  </dom-module>





<dom-module id="yt-visibility-monitor" assetpath="/yt-visibility-monitor/" css-build="shady">
  <template css-build="shady" class="style-scope yt-visibility-monitor">
    
  </template>
  </dom-module>

<dom-module id="yt-formatted-string" assetpath="/yt-formatted-string/" css-build="shady">
  
  <template strip-whitespace="" css-build="shady" class="style-scope yt-formatted-string">
    
  </template>
  </dom-module>

<dom-module id="yt-img-shadow" assetpath="/yt-img-shadow/" css-build="shady">
  
  <template strip-whitespace="" css-build="shady" class="style-scope yt-img-shadow">
    
    <img id="img" alt$="[[alt_]]" height="[[height]]" width="[[width]]" on-load="onLoad_" on-error="onError_" class="style-scope yt-img-shadow">
  </template>
  </dom-module>








































<dom-module id="ytd-guide-entry-renderer" assetpath="/ytd-guide-entry-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-entry-renderer">
    
    
    <a id="endpoint" class="yt-simple-endpoint style-scope ytd-guide-entry-renderer" href$="[[computeHref_(data.navigationEndpoint)]]" data="[[data.navigationEndpoint]]" tabindex="-1" title="[[getSimpleString(data.formattedTitle)]]" role="tablist">
      <paper-item aria-label$="[[ariaLabel]]" aria-selected$="[[ariaSelected]]" role="tab" class="style-scope ytd-guide-entry-renderer">
        <yt-icon class="guide-icon style-scope ytd-guide-entry-renderer" disable-upgrade$="[[data.thumbnail]]" hidden="[[data.thumbnail]]" icon="[[getIconType(data.icon.iconType)]]">
        </yt-icon>
        <yt-img-shadow disable-upgrade$="[[!data.thumbnail]]" height="24" hidden="[[!data.thumbnail]]" thumbnail="[[data.thumbnail]]" width="24" class="style-scope ytd-guide-entry-renderer">
        </yt-img-shadow>
        <yt-formatted-string class="title style-scope ytd-guide-entry-renderer" text="[[data.formattedTitle]]"></yt-formatted-string>
        <span class="guide-entry-count style-scope ytd-guide-entry-renderer">
          [[data.count]]
        </span>
        <yt-icon class="guide-entry-badge style-scope ytd-guide-entry-renderer" disable-upgrade$="[[!getBadgeIconType(data.badges)]]" icon="[[getBadgeIconType(data.badges)]]">
        </yt-icon>
        <div id="newness-dot" class="style-scope ytd-guide-entry-renderer"></div>
      </paper-item>
    </a>
  </template>
  </dom-module>

<dom-module id="ytd-guide-collapsible-entry-renderer" assetpath="/ytd-guide-collapsible-entry-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-collapsible-entry-renderer">
    
    <ytd-guide-entry-renderer id="expander-item" data="[[data.expanderItem.guideEntryRenderer]]" detail="[[isDetail]]" on-tap="onExpanderItemTapped_" class="style-scope ytd-guide-collapsible-entry-renderer">
    </ytd-guide-entry-renderer>
    <div id="expanded" class="style-scope ytd-guide-collapsible-entry-renderer">
      <div id="expandable-items" class="style-scope ytd-guide-collapsible-entry-renderer"></div>
      <ytd-guide-entry-renderer id="collapser-item" data="[[data.collapserItem.guideEntryRenderer]]" detail="[[isDetail]]" on-tap="onCollapserItemTapped_" class="style-scope ytd-guide-collapsible-entry-renderer">
      </ytd-guide-entry-renderer>
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-guide-collapsible-section-entry-renderer" assetpath="/ytd-guide-collapsible-section-entry-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-collapsible-section-entry-renderer">
    
    <div id="header" class="style-scope ytd-guide-collapsible-section-entry-renderer">
      <ytd-guide-entry-renderer id="header-entry" data="[[data.headerEntry.guideEntryRenderer]]" class="style-scope ytd-guide-collapsible-section-entry-renderer">
      </ytd-guide-entry-renderer>
    </div>
    <div id="section-items" class="style-scope ytd-guide-collapsible-section-entry-renderer"></div>
  </template>
  </dom-module>

<dom-module id="ytd-guide-section-renderer" assetpath="/ytd-guide-section-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-section-renderer">
    
    <h3 hidden="[[!data.formattedTitle]]" class="style-scope ytd-guide-section-renderer">
      <yt-formatted-string id="guide-section-title" text="[[data.formattedTitle]]" class="style-scope ytd-guide-section-renderer">
      </yt-formatted-string>
    </h3>
    <div id="items" class="style-scope ytd-guide-section-renderer"></div>
  </template>
  </dom-module>



<dom-module id="yt-render-button-shared-styles" assetpath="/yt-render-button-behavior/">
  <template>
    <style id="linter-paper-button-style">/**
       * This style preserves the styling previous to
       * https://github.com/PolymerElements/paper-button/pull/115
       * This change can break the layout of paper-button content.
       * Remove this style to apply the change, more details at b/70528356.
       */paper-button{display:inline-block;text-align:center;font-family:inherit;}</style>
    <style include="yt-base-styles"></style>
    <style>:host{display:inline-block;text-transform:uppercase;}:host(.force-icon-button) a{cursor:pointer;@apply --layout-horizontal;@apply --layout-center;@apply --layout-center-justified;}:host([disabled]) a:focus{outline:none;}:host([is-icon-button][has-no-text]){font-size:0;}a{@apply --layout;}a.yt-simple-endpoint{color:inherit;border-radius:inherit;text-decoration:none;}:host([is-paper-button]){/*
