<dom-module id="ytd-button-renderer" assetpath="/ytd-button-renderer/" css-build="shady">
  <template strip-whitespace="" css-build="shady" class="style-scope ytd-button-renderer">
    
    
    
    
  </template>
  </dom-module>

<dom-module id="ytd-guide-signin-promo-renderer" assetpath="/ytd-guide-signin-promo-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-signin-promo-renderer">
    
    <yt-formatted-string text="[[data.descriptiveText]]" class="style-scope ytd-guide-signin-promo-renderer"></yt-formatted-string>
    <ytd-button-renderer id="sign-in-button" align-by-text="[[alignByText]]" data="[[data.signInButton.buttonRenderer]]" on-tap="onSignInTap" class="style-scope ytd-guide-signin-promo-renderer">
    </ytd-button-renderer>
  </template>
  </dom-module>

<dom-module id="ytd-guide-renderer" assetpath="/ytd-guide-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-guide-renderer">
    
    <div id="sections" class="style-scope ytd-guide-renderer"></div>
    <div id="footer" hidden="[[!showFooter_]]" class="style-scope ytd-guide-renderer">
      <div id="guide-links-primary" class="style-scope ytd-guide-renderer">
        <slot name="guide-links-primary" class="style-scope ytd-guide-renderer"></slot>
      </div>
      <div id="guide-links-secondary" class="style-scope ytd-guide-renderer">
        <slot name="guide-links-secondary" class="style-scope ytd-guide-renderer"></slot>
      </div>
      <slot name="vat-notice" class="style-scope ytd-guide-renderer"></slot>
      <slot name="copyright" class="style-scope ytd-guide-renderer"></slot>
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-consent-bump-lightbox" assetpath="/ytd-consent-bump-lightbox/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-consent-bump-lightbox">
    
    <paper-dialog id="dialog" class="style-scope ytd-consent-bump-lightbox">
      <iframe id="iframe" class="style-scope ytd-consent-bump-lightbox"></iframe>
    </paper-dialog>
  </template>
  </dom-module>

<dom-module id="ytd-consent-bump-renderer" assetpath="/ytd-consent-bump-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-consent-bump-renderer">
    
    
    <yt-icon id="consent-shield" icon="yt-icons:[[getConsentBumpIcon_(data.securityIcon.iconType)]]" class="style-scope ytd-consent-bump-renderer">
    </yt-icon>
    <yt-formatted-string id="alert-message" text="[[data.alertMessage]]" class="style-scope ytd-consent-bump-renderer">
    </yt-formatted-string>
    <ytd-button-renderer id="remind-me-later-button" data="[[data.remindMeLaterButton.buttonRenderer]]" on-tap="onRemindMeLaterTap_" class="style-scope ytd-consent-bump-renderer">
    </ytd-button-renderer>
    <ytd-button-renderer id="review-button" data="[[data.reviewButton.buttonRenderer]]" on-tap="onReviewTap_" class="style-scope ytd-consent-bump-renderer">
    </ytd-button-renderer>
  </template>
  </dom-module>

<dom-module id="ytd-notification-topbar-button-renderer" assetpath="/ytd-notification-topbar-button-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-notification-topbar-button-renderer">
    
    
    <div id="button" class="style-scope ytd-notification-topbar-button-renderer">
      
    </div>
    <yt-icon id="blue-info-notification-icon" hidden="[[!showHighPriorityNotificationIcon_]]" icon="yt-icons:info" class="style-scope ytd-notification-topbar-button-renderer"></yt-icon>
    <div id="notification-count" hidden="[[!showNotificationCount_]]" class="style-scope ytd-notification-topbar-button-renderer">
      [[unseenCount_]]
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-searchbox" assetpath="/ytd-searchbox/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-searchbox">
    
    <form id="search-form" action="/results" class="style-scope ytd-searchbox">
      <div id="container" class="style-scope ytd-searchbox">
        <slot name="search-input" class="style-scope ytd-searchbox"></slot>
        <slot name="search-container" class="style-scope ytd-searchbox"></slot>
      </div>
      <button id="search-icon-legacy" aria-label$="[[placeholder_]]" class="style-scope ytd-searchbox">
        <yt-icon icon="[[icon_]]" class="style-scope ytd-searchbox">
        </yt-icon>
        <paper-tooltip prefix="" class="style-scope ytd-searchbox">[[placeholder_]]</paper-tooltip>
      </button>
    </form>
    <yt-icon-button id="voice-search-button" on-tap="voiceStart_" class="style-scope ytd-searchbox">
      <yt-icon icon="yt-icons:microphone_on" class="style-scope ytd-searchbox"></yt-icon>
    </yt-icon-button>
  </template>
  </dom-module>

<dom-module id="ytd-yoodle-renderer" assetpath="/ytd-yoodle-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-yoodle-renderer">
    
    <template is="dom-if" if="[[data.isAnimated]]" class="style-scope ytd-yoodle-renderer">
      <img id="animated-yoodle" src$="[[computeEmptyGif()]]" usemap$="[[useMapLink]]" on-load="onLoad" class="style-scope ytd-yoodle-renderer">
    </template>
    <template is="dom-if" if="[[!data.isAnimated]]" class="style-scope ytd-yoodle-renderer">
      <img src$="[[computeThumbnailUrl(data.thumbnail)]]" usemap$="[[useMapLink]]" class="style-scope ytd-yoodle-renderer">
    </template>
    <map name="[[mapId]]" class="style-scope ytd-yoodle-renderer">
      <area alt="[[data.logoTitleText]]" coords="[[scaleCoords(data.logoCoords)]]" href="[[computeUrlForEndpoint(data.homeEndpoint)]]" shape="rect" title="[[data.logoTitleText]]" class="style-scope ytd-yoodle-renderer">
      <area alt="[[data.translatedAltText]]" coords="[[scaleCoords(data.doodleCoords)]]" href="[[computeUrlForEndpoint(data.doodleEndpoint)]]" shape="rect" title="[[data.translatedAltText]]" class="style-scope ytd-yoodle-renderer">
    </map>
  </template>
  </dom-module>

<dom-module id="ytd-topbar-logo-renderer" assetpath="/ytd-topbar-logo-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-topbar-logo-renderer">
    
    
    <template is="dom-if" if="[[!showYoodle]]" class="style-scope ytd-topbar-logo-renderer">
      <a class="yt-simple-endpoint style-scope ytd-topbar-logo-renderer" href$="[[computeHref_(data.endpoint)]]" id="logo" data="[[data.endpoint]]" title="[[tooltipText]]">
        <div id="logo-icon-container" class="yt-icon-container style-scope ytd-topbar-logo-renderer" hidden="[[isRedLogo]]"></div>
        <div id="logo-red-icon-container" class="yt-icon-container style-scope ytd-topbar-logo-renderer" hidden="[[!isRedLogo]]"></div>
        <yt-icon id="logo-icon" disable-upgrade$="[[isRedLogo]]" hidden="[[isRedLogo]]" icon="yt-logos-ext:yt-logo" target-container="logo-icon-container" class="style-scope ytd-topbar-logo-renderer">
        </yt-icon>
        <yt-icon id="logo-red-icon" disable-upgrade$="[[!isRedLogo]]" hidden="[[!isRedLogo]]" icon="yt-logos-ext:yt-logo-red" target-container="logo-red-icon-container" class="style-scope ytd-topbar-logo-renderer">
        </yt-icon>
      </a>
      <span id="country-code" class="style-scope ytd-topbar-logo-renderer">[[countryCode]]</span>
    </template>
    <ytd-yoodle-renderer data="[[data.yoodle.yoodleRenderer]]" disable-upgrade$="[[!showYoodle]]" hidden="[[!showYoodle]]" class="style-scope ytd-topbar-logo-renderer">
    </ytd-yoodle-renderer>
  </template>
  </dom-module>

<dom-module id="ytd-topbar-menu-button-renderer" assetpath="/ytd-topbar-menu-button-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-topbar-menu-button-renderer">
    
    
    <template is="dom-if" if="[[data.avatar]]" class="style-scope ytd-topbar-menu-button-renderer">
      <button id="avatar-btn" aria-haspopup="true" aria-label$="[[data.accessibility.accessibilityData.label]]" class="style-scope ytd-topbar-menu-button-renderer">
        <yt-img-shadow height="32" thumbnail="[[data.avatar]]" width="32" class="style-scope ytd-topbar-menu-button-renderer"></yt-img-shadow>
      </button>
    </template>
    <div id="button" class="style-scope ytd-topbar-menu-button-renderer">
      
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-masthead" assetpath="/ytd-masthead/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-masthead">
    
    <iron-media-query query="max-width: 656px" query-matches="{{narrow_}}" class="style-scope ytd-masthead"></iron-media-query>
    <div id="ticker" class="style-scope ytd-masthead"></div>
