      <yt-icon-button id="back-button" label="[[menuStrings_.BACK_ALT_LABEL]]" on-tap="onSearchCloseClick_" class="style-scope ytd-masthead">
        <yt-icon disable-upgrade$="[[!showInput]]" icon="yt-icons:arrow-back" class="style-scope ytd-masthead">
        </yt-icon>
      </yt-icon-button>
      <paper-tooltip id="back-button-tooltip" disable-upgrade$="[[!showInput]]" for="back-button" class="style-scope ytd-masthead">
        [[menuStrings_.BACK_ALT_LABEL]]
      </paper-tooltip>
      <yt-icon-button id="guide-button" label="[[menuStrings_.GUIDE_ALT_LABEL]]" pressed="[[guideOpened]]" toggleable="true" on-keydown="onGuideButtonKeydown_" on-mouseenter="onGuideToggleHover_" on-tap="onGuideToggleTap_" class="style-scope ytd-masthead">
        <yt-icon id="guide-icon" icon="yt-icons:menu" class="style-scope ytd-masthead"></yt-icon>
