      </ytd-topbar-logo-renderer>
      <div id="skip-navigation" class="style-scope ytd-masthead"></div>
      <ytd-searchbox id="search" data="[[data.searchbox.fusionSearchboxRenderer]]" class="style-scope ytd-masthead">
        <slot name="search-container" slot="search-container" class="style-scope ytd-masthead"></slot>
        <slot name="search-input" slot="search-input" class="style-scope ytd-masthead"></slot>
      </ytd-searchbox>
      <div id="end" class="style-scope ytd-masthead">
