        <yt-icon-button id="search-button" label="[[menuStrings_.SEARCH_ALT_LABEL]]" on-tap="openOnClick_" class="style-scope ytd-masthead">
          <yt-icon class="topbar-icons style-scope ytd-masthead" disable-upgrade$="[[!narrow_]]" icon="yt-icons:search">
          </yt-icon>
        </yt-icon-button>
        <paper-tooltip disable-upgrade$="[[!narrow_]]" for="search-button" hidden="[[!narrow_]]" class="style-scope ytd-masthead">
