<dom-module id="ytd-banner-promo-renderer" assetpath="/ytd-banner-promo-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-banner-promo-renderer">
    
    <template is="dom-if" if="[[data.isVisible]]" class="style-scope ytd-banner-promo-renderer">
      <div class="ytd-banner-promo-renderer-background style-scope ytd-banner-promo-renderer" style$="[[computeBackgroundImgStyle_(data.style.styleType, data.backgroundImage)]]">
        <ytd-button-renderer id="dismiss-button" align-by-text="" data="[[data.dismissButton.buttonRenderer]]" on-tap="onDismissTap_" class="style-scope ytd-banner-promo-renderer">
        </ytd-button-renderer>
        <div class="ytd-banner-promo-renderer-layout-container style-scope ytd-banner-promo-renderer">
          <div class="ytd-banner-promo-renderer-layout style-scope ytd-banner-promo-renderer">
            <template is="dom-if" if="[[computeUseInlineImg_(data.style.styleType)]]" class="style-scope ytd-banner-promo-renderer">
              <img alt="" class="ytd-banner-promo-renderer-inline-image style-scope ytd-banner-promo-renderer" src$="[[computeUrlImg_(data.backgroundImage)]]">
            </template>
            <template is="dom-if" if="[[data.logoImage]]" class="style-scope ytd-banner-promo-renderer">
              <h1 class="ytd-banner-promo-renderer-logo style-scope ytd-banner-promo-renderer">
                <yt-img-shadow height="[[computeLogoHeight_(data.style.styleType)]]" thumbnail="[[data.logoImage]]" class="style-scope ytd-banner-promo-renderer">
                </yt-img-shadow>
              </h1>
            </template>
            <div class="ytd-banner-promo-renderer-content style-scope ytd-banner-promo-renderer">
              <h2 class="ytd-banner-promo-renderer-title style-scope ytd-banner-promo-renderer" hidden="[[!data.title]]">[[getSimpleString(data.title)]]</h2>
              <div class="ytd-banner-promo-renderer-promo-text style-scope ytd-banner-promo-renderer" hidden="[[!data.promoText]]">[[getSimpleString(data.promoText)]]</div>
              <ul class="ytd-small-features style-scope ytd-banner-promo-renderer">
                <template is="dom-repeat" items="[[data.smallFeatures]]" class="style-scope ytd-banner-promo-renderer">
                  <li class="ytd-small-feature-header style-scope ytd-banner-promo-renderer">
                    [[getSimpleString(item.musicPassSmallFeatureInfoRenderer.header)]]
                  </li>
                </template>
              </ul>
              <ytd-button-renderer id="action-button" align-by-text="" data="[[data.actionButton.buttonRenderer]]" invisible$="[[!data.actionButton.buttonRenderer]]" class="style-scope ytd-banner-promo-renderer">
              </ytd-button-renderer>
            </div>
          </div>
        </div>
      </div>
    </template>
  </template>
  </dom-module>

