          <yt-icon-button aria-label$="[[menuStrings_.BACK_ALT_LABEL]]" on-tap="onBackTap_" class="style-scope ytd-account-settings">
            <yt-icon icon="yt-icons:arrow-back" class="style-scope ytd-account-settings"></yt-icon>
          </yt-icon-button>
