<dom-module id="ytd-calendar-date-picker" assetpath="/ytd-calendar-date-picker/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-calendar-date-picker">
    
    <paper-menu-button class="style-scope ytd-calendar-date-picker">
      <paper-button id="date-picker" class="dropdown-trigger style-scope ytd-calendar-date-picker" slot="dropdown-trigger" aria-labelledby="date-label-text" on-tap="openPicker">
        <div id="date-label-text" class="style-scope ytd-calendar-date-picker">[[dateText]]</div>
        <yt-icon id="label-icon" icon="yt-icons:arrow-drop-down" class="style-scope ytd-calendar-date-picker">
        </yt-icon>
      </paper-button>
    </paper-menu-button>
    
    <paper-dialog id="calendar-dialog" dynamic-align="" horizontal-align="left" vertical-align="top" vertical-offset="44" class="style-scope ytd-calendar-date-picker">
      <div id="control-area" class="style-scope ytd-calendar-date-picker">
        <form id="date-input" on-submit="onFormSubmit" autocomplete="off" class="style-scope ytd-calendar-date-picker">
          <paper-input-container aria-label="Enter date" invalid="[[errorMessage]]" no-label-float="" use-v2-underline="" on-input="onDateTextChange" class="style-scope ytd-calendar-date-picker">
            <iron-input slot="input" bind-value="[[dateText]]" class="style-scope ytd-calendar-date-picker">
              <input id="textbox" autofocus="" class="style-scope ytd-calendar-date-picker"></iron-input>
            <paper-input-error slot="add-on" class="style-scope ytd-calendar-date-picker">[[errorMessage]]</paper-input-error>
          </paper-input-container>
        </form>
        <div id="month-controller" class="style-scope ytd-calendar-date-picker">
          <yt-icon-button id="prev-month" on-tap="scrollToPrevMonth" class="style-scope ytd-calendar-date-picker">
            <yt-icon icon="yt-icons:chevron_left" class="style-scope ytd-calendar-date-picker"></yt-icon>
          </yt-icon-button>
          <yt-icon-button id="next-month" on-tap="scrollToNextMonth" class="style-scope ytd-calendar-date-picker">
            <yt-icon icon="yt-icons:chevron_right" class="style-scope ytd-calendar-date-picker"></yt-icon>
          </yt-icon-button>
        </div>
      </div>
      <div class="calendar-container style-scope ytd-calendar-date-picker">
        <div class="calendar-header style-scope ytd-calendar-date-picker">
          <template is="dom-repeat" items="[[renderData.daysOfWeekLabel]]" as="dayLabel" class="style-scope ytd-calendar-date-picker">
            <span class="calendar-header-day style-scope ytd-calendar-date-picker">[[dayLabel]]</span>
          </template>
        </div>
        <iron-list id="calendar-main" as="month" items="[[renderData.months]]" tabindex="-1" class="style-scope ytd-calendar-date-picker">
          <template class="style-scope ytd-calendar-date-picker">
            <div class="calendar-month style-scope ytd-calendar-date-picker">
              <div class$="calendar-month-label [[month.monthLabelExtraCssClass]]" class="style-scope ytd-calendar-date-picker">
                [[month.monthLabel]]
              </div>
              <template is="dom-repeat" items="[[month.weeks]]" as="week" class="style-scope ytd-calendar-date-picker">
                <div class="calendar-week style-scope ytd-calendar-date-picker">
                  <template is="dom-repeat" items="[[week]]" as="day" class="style-scope ytd-calendar-date-picker">
                    <span class$="calendar-day [[day.extraCssClass]] [[day.debugClass]]" on-tap="handleDayClick" class="style-scope ytd-calendar-date-picker">
                      [[day.date.day]]
                    </span>
                  </template> 
                </div>
              </template> 
            </div>
          </template>
        </iron-list> 
      </div>
    </paper-dialog>
  </template>
  </dom-module>

