<dom-module id="yt-paid-memberships-item-section-styles" assetpath="/yt-paid-memberships-styles/">
  <template>
    <style>/**
       * Styles for displaying SubscriptionProductUpsellRenderers in a responsive grid.
       *
       * This would ideally be done with flexbox instead, but that would require
       * ytd-item-section-renderer and ytmusic-item-section-renderer to use display:flex as
       * there\'s no containing renderer around the list of SubscriptionProductUpsellRenderers
       * to add display:flex to.
       *
       * These breakpoints come from main app, but also work well in remix.
       *
       * TODO(josheverett): Convert to flexbox if containing renderer is added.
       * TODO(josheverett): Consider further improvements via ytd-guide-service.
       */yt-subscription-product-renderer,
      yt-subscription-product-upsell-offer-renderer{display:inline-block;box-sizing:border-box;margin:0 0 24px;vertical-align:top;width:100%;}/* 2 tiles. */@media (min-width: 876px){yt-subscription-product-renderer,
        yt-subscription-product-upsell-offer-renderer{width:50%;}yt-subscription-product-renderer:nth-of-type(odd),
        yt-subscription-product-upsell-offer-renderer:nth-of-type(odd){padding:0 12px 0 0;}yt-subscription-product-renderer:nth-of-type(even),
        yt-subscription-product-upsell-offer-renderer:nth-of-type(even){padding:0 0 0 12px;}}/* 3 tiles. */@media (min-width: 1090px){yt-subscription-product-renderer,
        yt-subscription-product-upsell-offer-renderer{width:33.33%;}yt-subscription-product-renderer:nth-of-type(3n+1),
        yt-subscription-product-upsell-offer-renderer:nth-of-type(3n+1){padding:0 16px 0 0;}yt-subscription-product-renderer:nth-of-type(3n+2),
        yt-subscription-product-upsell-offer-renderer:nth-of-type(3n+2){padding:0 8px;}yt-subscription-product-renderer:nth-of-type(3n+3),
        yt-subscription-product-upsell-offer-renderer:nth-of-type(3n+3){padding:0 0 0 16px;}}</style>
  </template>
</dom-module>

