<dom-module id="yt-live-chat-item-shared-styles" assetpath="/yt-live-chat-item-behavior/">
  <template>
    <style>#timestamp{display:var(--yt-live-chat-item-timestamp-display, inline);margin:var(--yt-live-chat-item-timestamp-margin, 0 8px 0 0);color:var(--yt-live-chat-tertiary-text-color);font-size:11px;}#author-photo{display:block;margin-right:16px;overflow:hidden;border-radius:50%;@apply --layout-flex-none;}#menu-button{@apply --yt-live-chat-32px-icon-button;}#menu{position:absolute;top:0;bottom:0;right:0;/* We use transform instead of display:none to make sure it\'s always
         * tabbable, and shows up on focus -- for accessibility purposes. "transform"
         * is preferable to "position" or "text-indent", as the other two have layout
         * costs.
         */transform:translateX(100px);}:host(:hover) #menu,
      :host([menu-visible]) #menu{transform:none;}/* IE and Edge don\'t support :focus-within, so we have to define a separate
       * rule to prevent this unsupported selector from interfering with application
       * of the other two (supported) selectors above. */:host(:focus-within) #menu{transform:none;}/*
       * Styling for inline moderation action buttons.
       */#inline-action-button-container{/* Position the button container so that it covers the whole chat message.
         * Messages have 4px top and bottom padding, so we use -4px for the top and
         * bottom positions to ensure the button container covers the message content
         * box and padding. */position:absolute;top:-4px;right:0;bottom:-4px;left:0;background-color:var(--yt-live-chat-moderation-mode-hover-background-color);display:none;@apply --layout-center-center;}:host([has-inline-action-buttons]:hover) #inline-action-button-container{@apply --layout-horizontal;/* Hide the inline action buttons by default, but let ancestors override
         * this to display the buttons (for example, in response to user input). */display:var(--yt-live-chat-inline-action-button-container-display, none);}/* Allow the inline action buttons to be forcibly hidden. */:host([has-inline-action-buttons][hide-inline-action-buttons]:hover) #inline-action-button-container{display:none;}:host([has-inline-action-buttons]:hover) #menu{display:var(--yt-live-chat-item-with-inline-actions-context-menu-display, block);}#inline-action-buttons > *,
      #additional-inline-action-buttons > *{--yt-button-icon-size:36px;--yt-button-icon-padding:6px;color:white;border-radius:2px;}#inline-action-buttons > *{background:hsla(0, 0%, 6.7%, 0.8);}#inline-action-buttons > :hover{background:#111111;}#additional-inline-action-buttons > *{color:var(--yt-live-chat-additional-inline-action-button-color);background:var(--yt-live-chat-additional-inline-action-button-background-color);}#additional-inline-action-buttons > :hover{background:var(--yt-live-chat-additional-inline-action-button-background-color-hover);}#additional-inline-action-buttons:not(:empty){margin-left:32px;}#inline-action-buttons > *:not(:first-child),
      #additional-inline-action-buttons > *:not(:first-child){margin-left:8px;}</style>
  </template>
</dom-module>



