    <div id="content" class="style-scope ytd-sponsorships-heading-renderer">
      <yt-formatted-string id="title" text="[[data.title]]" class="style-scope ytd-sponsorships-heading-renderer"></yt-formatted-string>
      <div id="subtitle-content" hidden="[[!data.subtitle]]" class="style-scope ytd-sponsorships-heading-renderer">
        <yt-img-shadow id="subtitle-icon" hidden="[[!data.subtitleIcon]]" thumbnail="[[data.subtitleIcon]]" class="style-scope ytd-sponsorships-heading-renderer">
        </yt-img-shadow>
        <yt-formatted-string id="subtitle" text="[[data.subtitle]]" class="style-scope ytd-sponsorships-heading-renderer"></yt-formatted-string>
      </div>
      <div id="bottom-button" class="style-scope ytd-sponsorships-heading-renderer"></div>
    </div>
    <div id="end-button" class="style-scope ytd-sponsorships-heading-renderer"></div>
    </template>
    </dom-module>

<dom-module id="ytd-sponsorships-links-renderer" assetpath="/ytd-sponsorships-links-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-sponsorships-links-renderer">
    
    <template is="dom-repeat" items="[[data.links]]" class="style-scope ytd-sponsorships-links-renderer">
      <yt-formatted-string class="link style-scope ytd-sponsorships-links-renderer" text="[[item]]">
    </yt-formatted-string></template>
  </template>
  </dom-module>

<dom-module id="ytd-sponsorships-list-tile-renderer" assetpath="/ytd-sponsorships-list-tile-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-sponsorships-list-tile-renderer">
    
    <paper-button id="tile" class="tile style-scope ytd-sponsorships-list-tile-renderer" class$="[[getTileClasses(data.expandableItems)]]" disabled$="[[getButtonDisabled(data.expandableItems)]]" noink="" on-tap="onToggleExpand">
      <yt-img-shadow class="icon style-scope ytd-sponsorships-list-tile-renderer" thumbnail="[[data.icon]]"></yt-img-shadow>
      <div class="titles style-scope ytd-sponsorships-list-tile-renderer">
        <yt-formatted-string class="title style-scope ytd-sponsorships-list-tile-renderer" text="[[data.title]]"></yt-formatted-string>
        <yt-formatted-string class="subtitle style-scope ytd-sponsorships-list-tile-renderer" text="[[data.subtitle]]"></yt-formatted-string>
        <yt-formatted-string class="detail style-scope ytd-sponsorships-list-tile-renderer" text="[[data.detail]]"></yt-formatted-string>
      </div>
      <template is="dom-if" if="[[data.expandableItems]]" class="style-scope ytd-sponsorships-list-tile-renderer">
        <yt-icon class="expand-icon style-scope ytd-sponsorships-list-tile-renderer" icon="[[getExpansionIcon(expanded)]]"></yt-icon>
      </template>
    </paper-button>

    <template is="dom-if" if="[[expanded]]" class="style-scope ytd-sponsorships-list-tile-renderer">
      <div class="tiles-container style-scope ytd-sponsorships-list-tile-renderer">
        <template is="dom-repeat" items="[[data.expandableItems]]" class="style-scope ytd-sponsorships-list-tile-renderer">
          <template is="dom-if" if="[[item.sponsorshipsLoyaltyBadgesRenderer]]" class="style-scope ytd-sponsorships-list-tile-renderer">
            <ytd-sponsorships-loyalty-badges-renderer class="sponsorships-loyalty-badges-renderer style-scope ytd-sponsorships-list-tile-renderer" data="[[item.sponsorshipsLoyaltyBadgesRenderer]]"></ytd-sponsorships-loyalty-badges-renderer>
          </template>
          <template is="dom-if" if="[[item.sponsorshipsListTileRenderer]]" class="style-scope ytd-sponsorships-list-tile-renderer">
            <div class="tile style-scope ytd-sponsorships-list-tile-renderer">
              <yt-img-shadow class="icon style-scope ytd-sponsorships-list-tile-renderer" thumbnail="[[item.sponsorshipsListTileRenderer.icon]]">
              </yt-img-shadow>
              <div class="titles style-scope ytd-sponsorships-list-tile-renderer">
                <yt-formatted-string class="title style-scope ytd-sponsorships-list-tile-renderer" text="[[item.sponsorshipsListTileRenderer.title]]">
                </yt-formatted-string>
                <yt-formatted-string class="subtitle style-scope ytd-sponsorships-list-tile-renderer" text="[[item.sponsorshipsListTileRenderer.subtitle]]">
                </yt-formatted-string>
              </div>
            </div>
          </template>
        </template>
      </div>
    </template>
  </template>
  </dom-module>

<dom-module id="ytd-sponsorships-promotion-renderer" assetpath="/ytd-sponsorships-promotion-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-sponsorships-promotion-renderer">
    
    <div id="content" class="style-scope ytd-sponsorships-promotion-renderer">
      <div id="above-button" class="style-scope ytd-sponsorships-promotion-renderer">
        <yt-formatted-string class="above-redeem-button-text style-scope ytd-sponsorships-promotion-renderer" text="[[data.aboveRedeemButtonText]]"></yt-formatted-string>
        <ytd-badge-supported-renderer top-standalone-badge="[[data.badge]]" class="style-scope ytd-sponsorships-promotion-renderer">
        </ytd-badge-supported-renderer>
      </div>
      <div id="redeem-button" class="style-scope ytd-sponsorships-promotion-renderer"></div>
      <yt-formatted-string class="redeem-disclaimer style-scope ytd-sponsorships-promotion-renderer" split-lines="true" text="[[data.redeemDisclaimer]]"></yt-formatted-string>
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-sponsorships-tier-renderer" assetpath="/ytd-sponsorships-tier-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-sponsorships-tier-renderer">
    
    <div id="title" hidden="[[!displayTitle]]" class="style-scope ytd-sponsorships-tier-renderer">
      <yt-formatted-string text="[[data.title]]" class="style-scope ytd-sponsorships-tier-renderer"></yt-formatted-string>
    </div>
    <div id="subtitle" hidden="[[!data.abovePurchaseButtonText]]" class="style-scope ytd-sponsorships-tier-renderer">
    <yt-formatted-string id="above-purchase-button-text" text="[[data.abovePurchaseButtonText]]" class="style-scope ytd-sponsorships-tier-renderer"></yt-formatted-string>
    </div>
    <div id="premium-freebie-promo" class="style-scope ytd-sponsorships-tier-renderer"></div>
    <div id="header" class="style-scope ytd-sponsorships-tier-renderer">
      <div id="purchase-button" on-tap="onPurchaseButtonTap" class="style-scope ytd-sponsorships-tier-renderer"></div>
      <yt-formatted-string id="purchase-text" force-default-style="" hidden="[[!data.purchaseText]]" text="[[data.purchaseText]]" class="style-scope ytd-sponsorships-tier-renderer">
      </yt-formatted-string>
      <yt-formatted-string class="disclaimer style-scope ytd-sponsorships-tier-renderer" split-lines="true" text="[[data.disclaimer]]">
      </yt-formatted-string>
    </div>
    <div id="expandable-message" class="style-scope ytd-sponsorships-tier-renderer"></div>
    <div id="content" class="style-scope ytd-sponsorships-tier-renderer">
      <div id="perks_section" class="style-scope ytd-sponsorships-tier-renderer">
        <ytd-sponsorships-perks-renderer id="perks" data="[[data.perks.sponsorshipsPerksRenderer]]" expanded="[[expanded]]" class="style-scope ytd-sponsorships-tier-renderer"></ytd-sponsorships-perks-renderer>
      </div>
      <button id="expansion_call_to_action" on-tap="expansionCallToActionTap" hidden="[[!data.expansionCallToAction]]" class="style-scope ytd-sponsorships-tier-renderer">
        <yt-formatted-string text="[[expansionCTA(data, expanded)]]" class="style-scope ytd-sponsorships-tier-renderer"></yt-formatted-string>
        <yt-icon class="expand-icon style-scope ytd-sponsorships-tier-renderer" icon="[[getExpansionIcon(expanded)]]"></yt-icon>
      </button>
    </div>
    <div id="footer" class="style-scope ytd-sponsorships-tier-renderer">
      <yt-formatted-string id="bottom-disclaimer" class="disclaimer style-scope ytd-sponsorships-tier-renderer" split-lines="true" text="[[data.bottomDisclaimer]]">
      </yt-formatted-string>
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-sponsorships-management-renderer" assetpath="/ytd-sponsorships-management-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-sponsorships-management-renderer">
    
