<dom-module id="ytd-promoted-sparkles-text-search-renderer" assetpath="/ytd-promoted-sparkles-text-search-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-promoted-sparkles-text-search-renderer">
    
