      <div id="main-container" class="style-scope ytd-promoted-sparkles-text-search-renderer">
        <h3 id="title" aria-label$="[[data.content.title.accessibility.accessibilityData.label]]" title$="[[getSimpleString(data.content.title)]]" class="style-scope ytd-promoted-sparkles-text-search-renderer">
            [[getSimpleString(data.content.title)]]
        </h3>
        <yt-formatted-string id="description" ellipsis-truncate="" no-endpoints="[[noEndpoints]]" text="[[data.content.descriptionText]]" class="style-scope ytd-promoted-sparkles-text-search-renderer">
