        <div id="format-container" class="style-scope ytd-promoted-sparkles-text-search-renderer">
          <ytd-badge-supported-renderer id="ad-badge" top-standalone-badge="[[data.adBadge]]" class="style-scope ytd-promoted-sparkles-text-search-renderer">
          </ytd-badge-supported-renderer>
          <yt-formatted-string id="display-url" ellipsis-truncate="" no-endpoints="[[noEndpoints]]" text="[[data.content.websiteText]]" class="style-scope ytd-promoted-sparkles-text-search-renderer">
          </yt-formatted-string>
        </div>
      </div>
      <div id="right-container" class="style-scope ytd-promoted-sparkles-text-search-renderer">
