<dom-module id="ytd-web-answer-renderer" assetpath="/ytd-web-answer-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-web-answer-renderer">
    
    <div id="section-header" class="style-scope ytd-web-answer-renderer">
      <a id="section-title" class="yt-simple-endpoint style-scope ytd-web-answer-renderer" href$="[[computeHref_(data.command)]]" data="[[data.command]]">
        <yt-formatted-string text="[[data.sectionTitle]]" class="style-scope ytd-web-answer-renderer"></yt-formatted-string>
      </a>
      <div id="menu" class="style-scope ytd-web-answer-renderer"></div>
    </div>
    <a class="yt-simple-endpoint style-scope ytd-web-answer-renderer" href$="[[computeHref_(data.command)]]" data="[[data.command]]">
      <div id="content" class="style-scope ytd-web-answer-renderer">
        <div id="content-text" class="style-scope ytd-web-answer-renderer">
          <div id="content-title" class="style-scope ytd-web-answer-renderer">
            <yt-formatted-string id="content-title" text="[[data.contentTitle]]" class="style-scope ytd-web-answer-renderer">
            </yt-formatted-string>
            <yt-icon class="external-link-icon style-scope ytd-web-answer-renderer" icon="yt-icons:open_in_new"></yt-icon>
          </div>
          <yt-formatted-string id="body-text" text="[[data.bodyText]]" class="style-scope ytd-web-answer-renderer"></yt-formatted-string>
          <div id="source-group" class="style-scope ytd-web-answer-renderer">
            <yt-formatted-string text="[[data.sourceName]]" class="style-scope ytd-web-answer-renderer"></yt-formatted-string>
            <div id="separator" hidden="[[!data.publishedDate]]" class="style-scope ytd-web-answer-renderer">•</div>
            <yt-formatted-string text="[[data.publishedDate]]" class="style-scope ytd-web-answer-renderer"></yt-formatted-string>
          </div>
        </div>
        <yt-img-shadow id="answer-image" disable-upgrade$="[[!data.image]]" hidden="[[!data.image]]" thumbnail="[[data.image]]" width="100" class="style-scope ytd-web-answer-renderer">
        </yt-img-shadow>
      </div>
    </a>
    <a class="yt-simple-endpoint style-scope ytd-web-answer-renderer" hidden="[[!data.bottomLink]]" href$="[[computeHref_(data.bottomLinkCommand)]]" data="[[data.bottomLinkCommand]]">
      <div id="bottom-section" class="style-scope ytd-web-answer-renderer">
        <yt-icon icon="[[bottomIcon_]]" class="style-scope ytd-web-answer-renderer"></yt-icon>
        <yt-formatted-string id="bottom-link" text="[[data.bottomLink]]" class="style-scope ytd-web-answer-renderer"></yt-formatted-string>
      </div>
    </a>
  </template>
  </dom-module>

