    <div id="header" class="style-scope ytd-video-game-watch-card-renderer">
      <a class="yt-simple-endpoint style-scope ytd-video-game-watch-card-renderer" href$="[[computeHref_(data.navigationEndpoint)]]" data="[[data.navigationEndpoint]]">
        <h2 id="title" class="style-scope ytd-video-game-watch-card-renderer">[[getSimpleString(data.title)]]</h2>
      </a>
      <div id="meta" class="style-scope ytd-video-game-watch-card-renderer">
        <template is="dom-repeat" items="[[data.labels]]" class="style-scope ytd-video-game-watch-card-renderer">
          <div class="meta-label style-scope ytd-video-game-watch-card-renderer">[[getSimpleString(item)]]</div>
        </template>
      </div>
    </div>
      <a id="banner" class="yt-simple-endpoint style-scope ytd-video-game-watch-card-renderer" href$="[[computeHref_(data.navigationEndpoint)]]" data="[[data.navigationEndpoint]]">
      <yt-img-shadow id="bannerart" thumbnail="[[data.banner]]" class="style-scope ytd-video-game-watch-card-renderer"></yt-img-shadow>
      <yt-img-shadow id="boxart" thumbnail="[[data.boxart]]" class="style-scope ytd-video-game-watch-card-renderer"></yt-img-shadow>
    </a>
    <div id="videos" class="style-scope ytd-video-game-watch-card-renderer">
      <yt-formatted-string id="subaction" text="[[data.subaction]]" class="style-scope ytd-video-game-watch-card-renderer"></yt-formatted-string>
      <div id="video-list" class="style-scope ytd-video-game-watch-card-renderer">
        <template is="dom-repeat" items="[[data.videoList.watchCardVideoGameListRenderer.videos]]" class="style-scope ytd-video-game-watch-card-renderer">
          <div class="lockup style-scope ytd-video-game-watch-card-renderer">
            <div class="thumbnail-container style-scope ytd-video-game-watch-card-renderer">
              <ytd-thumbnail id="thumbnail" data="[[item.watchCardVideoRenderer]]" width="120" class="style-scope ytd-video-game-watch-card-renderer">
              </ytd-thumbnail>
              <div class="live-badge badge style-scope ytd-video-game-watch-card-renderer" hidden="[[!item.watchCardVideoRenderer.badges.0.liveBadge]]">
                [[getSimpleString(item.watchCardVideoRenderer.badges.0.liveBadge.label)]]
              </div>
            </div>
            <div class="info style-scope ytd-video-game-watch-card-renderer">
              <a class="yt-simple-endpoint video-title style-scope ytd-video-game-watch-card-renderer" href$="[[computeHref_(data.navigationEndpoint)]]" data="[[data.navigationEndpoint]]">
                [[getSimpleString(item.watchCardVideoRenderer.title)]]
              </a>
              <yt-formatted-string class="video-byline style-scope ytd-video-game-watch-card-renderer" text="[[item.watchCardVideoRenderer.byline]]">
              </yt-formatted-string>
              <yt-formatted-string class="video-views style-scope ytd-video-game-watch-card-renderer" text="[[item.watchCardVideoRenderer.views]]">
              </yt-formatted-string>
            </div>
          </div>
        </template>
      </div>
    </div>
    <a id="logo-container" class="yt-simple-endpoint style-scope ytd-video-game-watch-card-renderer" href$="[[computeHref_(data.gamingEndpoint)]]" data="[[data.gamingEndpoint]]">
