<dom-module id="ytd-watch-card-renderer" assetpath="/ytd-watch-card-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-watch-card-renderer">
    
    <ytd-generic-watch-card badges="[[data.badges]]" call-to-action="[[data.callToAction]]" header-style="[[data.headerStyle.value]]" labels="[[data.labels]]" lists="[[createArray(data.items)]]" navigation-endpoint="[[data.navigationEndpoint]]" related-data="[[data.relatedData]]" title="[[data.title]]" class="style-scope ytd-watch-card-renderer">
    </ytd-generic-watch-card>
  </template>
  </dom-module>

<dom-module id="ytd-secondary-search-container-renderer" assetpath="/ytd-secondary-search-container-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-secondary-search-container-renderer">
    
    <div id="contents" class="style-scope ytd-secondary-search-container-renderer"></div>
  </template>
  </dom-module>

<dom-module id="ytd-two-column-search-results-renderer" assetpath="/ytd-two-column-search-results-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-two-column-search-results-renderer">
    
    <div id="primary" class="style-scope ytd-two-column-search-results-renderer">
      <ytd-section-list-renderer data="[[data.primaryContents.sectionListRenderer]]" is-search="[[isSearch]]" is-search-dova="[[isSearchDova]]" class="style-scope ytd-two-column-search-results-renderer">
      </ytd-section-list-renderer>
      <div id="continuations" class="style-scope ytd-two-column-search-results-renderer"></div>
    </div>
    <ytd-secondary-search-container-renderer id="secondary" data="[[data.secondaryContents.secondarySearchContainerRenderer]]" disable-upgrade$="[[!showSecondaryColumn_]]" hidden="[[!showSecondaryColumn_]]" class="style-scope ytd-two-column-search-results-renderer">
    </ytd-secondary-search-container-renderer>
  </template>
  </dom-module>

<dom-module id="ytd-search" assetpath="/ytd-search/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-search">
    
    
    <div id="container" class="style-scope ytd-search">
      <ytd-two-column-search-results-renderer active="[[active]]" center-results="[[centerResults]]" data="[[data.contents.twoColumnSearchResultsRenderer]]" hidden="[[data.hideContents]]" is-search="true" class="style-scope ytd-search">
      </ytd-two-column-search-results-renderer>
    </div>
    <div id="survey" class="style-scope ytd-search"></div>
  </template>
  </dom-module>

<dom-module id="yt-player-error-message-renderer" assetpath="/yt-player-error-message-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-player-error-message-renderer">
    
    <yt-icon icon="[[icon_]]" class="style-scope yt-player-error-message-renderer"></yt-icon>
    <div id="info" class="style-scope yt-player-error-message-renderer">
      <div class="reason style-scope yt-player-error-message-renderer">[[getSimpleString(data.reason)]]</div>
      <yt-formatted-string class="subreason style-scope yt-player-error-message-renderer" text="[[data.subreason]]"></yt-formatted-string>
      <yt-formatted-string class="more style-scope yt-player-error-message-renderer" text="[[data.learnMore]]"></yt-formatted-string>
      <div id="button" class="style-scope yt-player-error-message-renderer"></div>
    </div>
  </template>
  </dom-module>

<dom-module id="yt-player-kav-renderer" assetpath="/yt-player-kav-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-player-kav-renderer">
    
    <yt-icon icon="[[icon_]]" class="style-scope yt-player-kav-renderer"></yt-icon>
    <div id="info" class="style-scope yt-player-kav-renderer">
      <div class="reason style-scope yt-player-kav-renderer">[[getSimpleString(data.reason)]]</div>
      <div class="subreason style-scope yt-player-kav-renderer">[[getSimpleString(data.subreason)]]</div>
      <yt-formatted-string class="more style-scope yt-player-kav-renderer" text="[[data.learnMore]]"></yt-formatted-string>
      <div id="button" class="style-scope yt-player-kav-renderer"></div>
    </div>
  </template>
  </dom-module>

<dom-module id="yt-playability-error-supported-renderers" assetpath="/yt-playability-error-supported-renderers/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-playability-error-supported-renderers">
    
    <div id="container" class="style-scope yt-playability-error-supported-renderers"></div>
  </template>
  </dom-module>


<dom-module id="ytd-live-chat-frame" assetpath="/ytd-live-chat-frame/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-live-chat-frame">
    
    <iframe frameborder="0" scrolling="no" id="chatframe" class="style-scope ytd-live-chat-frame"></iframe>
    <template is="dom-if" if="[[data.conversationBarRenderer.availabilityMessage]]" class="style-scope ytd-live-chat-frame">
      <ytd-message-renderer data="[[data.conversationBarRenderer.availabilityMessage.messageRenderer]]" class="style-scope ytd-live-chat-frame">
      </ytd-message-renderer>
    </template>
    <div id="show-hide-button" class="style-scope ytd-live-chat-frame"></div>
  </template>
  </dom-module>

<dom-module id="ytd-pla-shelf-renderer" assetpath="/ytd-pla-shelf-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-pla-shelf-renderer">
    
    <template is="dom-if" if="[[data.itemList.horizontalListRenderer]]" class="style-scope ytd-pla-shelf-renderer">
      <div id="banner" class="style-scope ytd-pla-shelf-renderer">
        <span id="title" class="style-scope ytd-pla-shelf-renderer">[[getSimpleString(data.shopText)]]</span>
        <div id="banner-right" class="style-scope ytd-pla-shelf-renderer">
          <div id="info-container" class="style-scope ytd-pla-shelf-renderer">
            <yt-icon id="info-icon" hidden="[[data.adInfoButton]]" icon="yt-icons:info" class="style-scope ytd-pla-shelf-renderer"></yt-icon>
            <ytd-button-renderer id="info-button" data="[[data.adInfoButton.buttonRenderer]]" hidden="[[!data.adInfoButton]]" class="style-scope ytd-pla-shelf-renderer">
            </ytd-button-renderer>
            <span id="sponsored-text" class="style-scope ytd-pla-shelf-renderer">[[getSimpleString(data.sponsoredText)]]</span>
          </div>
          <yt-icon-button id="expand-button" on-tap="onToggleTap_" class="style-scope ytd-pla-shelf-renderer">
            <yt-icon id="expand-icon" icon="yt-icons:expand-less" class="style-scope ytd-pla-shelf-renderer"></yt-icon>
          </yt-icon-button>
        </div>
        <paper-tooltip id="ad-info-tooltip" for="info-container" hidden="[[data.adInfoButton]]" position="bottom" class="style-scope ytd-pla-shelf-renderer">
          <span class="style-scope ytd-pla-shelf-renderer">[[getSimpleString(data.adInfoText)]]</span>
        </paper-tooltip>
      </div>
      <yt-horizontal-list-renderer data="[[data.itemList.horizontalListRenderer]]" hidden="[[collapsed_]]" class="style-scope ytd-pla-shelf-renderer">
      </yt-horizontal-list-renderer>
    </template>
  </template>
  </dom-module>

<dom-module id="ytd-third-party-manager" assetpath="/ytd-third-party-manager/" css-build="shady">
  <template css-build="shady" class="style-scope ytd-third-party-manager">
    
  </template>
  </dom-module>

<dom-module id="yt-notification-action-renderer" assetpath="/yt-notification-action-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-notification-action-renderer">
    
    <paper-toast id="toast" class$="[[computeButtonClass_(data.actionButton.buttonRenderer)]]" allow-click-through="" duration="[[duration]]" text="[[computeText_(data.responseText)]]" class="style-scope yt-notification-action-renderer">
      <template is="dom-if" if="[[data.actionButton]]" class="style-scope yt-notification-action-renderer">
        <yt-button-renderer id="action-button" data="[[data.actionButton.buttonRenderer]]" on-tap="close" class="style-scope yt-notification-action-renderer">
        </yt-button-renderer>
      </template>
      <slot class="style-scope yt-notification-action-renderer"></slot>
    </paper-toast>
  </template>
  </dom-module>

<dom-module id="ytd-video-quality-promo-renderer" assetpath="/ytd-video-quality-promo-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-video-quality-promo-renderer">
    
    <div id="container" class="style-scope ytd-video-quality-promo-renderer">
      <yt-notification-action-renderer id="notification" data="[[data.snackbar.notificationActionRenderer]]" duration="0" class="style-scope ytd-video-quality-promo-renderer">
        <yt-icon id="close" icon="yt-icons:dismissal" on-tap="closePromo" class="style-scope ytd-video-quality-promo-renderer"></yt-icon>
      </yt-notification-action-renderer>
    </div>
  </template>
  </dom-module>

















<dom-module id="ytd-donation-shelf-renderer" assetpath="/ytd-donation-shelf-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-donation-shelf-renderer">
    
    <div id="header-section" class="style-scope ytd-donation-shelf-renderer">
      <div id="header-text" class="style-scope ytd-donation-shelf-renderer">
        [[getSimpleString(data.headerTitle)]]
      </div>
      <template is="dom-if" if="[[headerBackgroundUrl_]]" class="style-scope ytd-donation-shelf-renderer">
        <div id="header-background" class$="[[headerBackgroundClass()]]" class="style-scope ytd-donation-shelf-renderer">
          <yt-img-shadow delayed-src="[[headerBackgroundUrl_]]" height="48" class="style-scope ytd-donation-shelf-renderer">
          </yt-img-shadow>
        </div>
      </template>
    </div>

    <div id="donate-section" class="style-scope ytd-donation-shelf-renderer">
      <div id="title-row" class="style-scope ytd-donation-shelf-renderer">
        <yt-img-shadow id="campaign-logo" object-fit="CONTAIN" thumbnail="[[data.campaignThumbnail]]" class="style-scope ytd-donation-shelf-renderer">
        </yt-img-shadow>
        <div id="text-container" class="style-scope ytd-donation-shelf-renderer">
          <div id="campaign-title" class="style-scope ytd-donation-shelf-renderer">
            [[getSimpleString(data.campaignTitle)]]
          </div>
          <div id="campaign-subtitle" class="style-scope ytd-donation-shelf-renderer">
            [[getSimpleString(data.campaignSubtitle)]]
          </div>
        </div>
        <div id="donate-button" on-tap="onDonateTap_" class="style-scope ytd-donation-shelf-renderer"></div>
      </div>
      <template is="dom-if" if="[[isProgressBarVisible(data)]]" class="style-scope ytd-donation-shelf-renderer">
        <div id="progress-bar" class="style-scope ytd-donation-shelf-renderer">
          <div id="progress-bar-fill" class="style-scope ytd-donation-shelf-renderer"></div>
        </div>
        <div id="progress-bar-labels" class="style-scope ytd-donation-shelf-renderer">
          <yt-formatted-string id="progress-bar-start" text="[[data.startLabel]]" class="style-scope ytd-donation-shelf-renderer">
          </yt-formatted-string>
          <yt-formatted-string id="progress-bar-end" text="[[data.endLabel]]" class="style-scope ytd-donation-shelf-renderer"></yt-formatted-string>
        </div>
      </template>
      <template is="dom-if" if="[[data.amountRaisedLabel]]" class="style-scope ytd-donation-shelf-renderer">
        <div id="amount-raised" class="style-scope ytd-donation-shelf-renderer">
          <yt-formatted-string text="[[data.amountRaisedLabel]]" class="style-scope ytd-donation-shelf-renderer"></yt-formatted-string>
        </div>
      </template>
      <template is="dom-if" if="[[data.matchLabel]]" class="style-scope ytd-donation-shelf-renderer">
