<dom-module id="ytd-ticket-shelf-renderer" assetpath="/ytd-ticket-shelf-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-ticket-shelf-renderer">
    
    <div id="head" class="style-scope ytd-ticket-shelf-renderer">
      <h1 id="title" role="heading" aria-label$="[[firstEvent.title]]" class="style-scope ytd-ticket-shelf-renderer">[[firstEvent.title]]</h1>

      <a id="info-container" href="javascript:" role="complementary" aria-label$="[[data.informationText]]" class="style-scope ytd-ticket-shelf-renderer">
        <yt-icon id="info-icon" icon="yt-icons:info" class="style-scope ytd-ticket-shelf-renderer"></yt-icon>
      </a>
      
      <paper-tooltip id="banner-info-tooltip" for="info-container" manual-mode="" position="bottom" class="style-scope ytd-ticket-shelf-renderer">
        <div class="style-scope ytd-ticket-shelf-renderer">[[data.informationText]]</div>
      </paper-tooltip>
    </div>
    <div id="body" class="style-scope ytd-ticket-shelf-renderer">
      <div id="primary-event" class="style-scope ytd-ticket-shelf-renderer">
        <template is="dom-if" if="[[data.useCalendarAvatar]]" class="style-scope ytd-ticket-shelf-renderer">
          <a id="calendar-avatar" href="javascript:void(0)" on-tap="onFirstEventTap" class="style-scope ytd-ticket-shelf-renderer">
            <div id="calendar-avatar-month" class="style-scope ytd-ticket-shelf-renderer">
              <div id="calendar-avatar-month-text" class="style-scope ytd-ticket-shelf-renderer">[[firstEvent.timeMonth]]</div>
            </div>
            <div id="calendar-avatar-day" class="style-scope ytd-ticket-shelf-renderer">
              <div id="calendar-avatar-day-text" class="style-scope ytd-ticket-shelf-renderer">[[firstEvent.timeDay]]</div>
            </div>
          </a>
        </template>

        <template is="dom-if" if="[[!data.useCalendarAvatar]]" class="style-scope ytd-ticket-shelf-renderer">
          <div id="thumbnail" class="style-scope ytd-ticket-shelf-renderer">
            <yt-img-shadow id="thumbnail-img" fit="" thumbnail="[[firstEvent.thumbnail]]" class="style-scope ytd-ticket-shelf-renderer">
            </yt-img-shadow>
          </div>
        </template>

        <div id="meta" class="style-scope ytd-ticket-shelf-renderer">
          <div id="meta-info" class="style-scope ytd-ticket-shelf-renderer">
            <a id="nearest-with-location" href="javascript:void(0)" on-tap="onFirstEventTap" class="style-scope ytd-ticket-shelf-renderer">[[data.title]]</a>
            <div id="subtitle1" class="style-scope ytd-ticket-shelf-renderer">[[firstEvent.subtitle1]]</div>
            <template is="dom-if" if="[[firstEvent.hasMultipleOffers]]" class="style-scope ytd-ticket-shelf-renderer">
              <div id="subtitle2" class="style-scope ytd-ticket-shelf-renderer">
                [[firstEvent.subtitle2]]
              </div>
            </template>
            <template is="dom-if" if="[[!firstEvent.hasMultipleOffers]]" class="style-scope ytd-ticket-shelf-renderer">
              <a class="vendor style-scope ytd-ticket-shelf-renderer" target="_blank" on-tap="onFirstEventTap" href$="[[firstEvent.buttonCommand.urlEndpoint.url]]">
                [[firstEvent.linkText]]
              </a>
            </template>
          </div>
          <a id="view-tickets-link" href="javascript:void(0)" on-tap="onFirstEventTap" class="style-scope ytd-ticket-shelf-renderer">
            [[firstEvent.buttonText]]
            <template is="dom-if" if="[[!firstEvent.hasMultipleOffers]]" class="style-scope ytd-ticket-shelf-renderer">
              <yt-icon class="launch-icon style-scope ytd-ticket-shelf-renderer" icon="yt-icons:launch"></yt-icon>
            </template>
          </a>
        </div>
      </div>

      <div id="separator" class="style-scope ytd-ticket-shelf-renderer"></div>

      <div id="rest-events" class="style-scope ytd-ticket-shelf-renderer">
        <div id="table" class="style-scope ytd-ticket-shelf-renderer">
          <table cellspacing="0" cellpadding="0" class="style-scope ytd-ticket-shelf-renderer">
            <template is="dom-repeat" items="{{restEvents}}" as="item" class="style-scope ytd-ticket-shelf-renderer">
              <tr on-tap="onTicketLinkTap" class="style-scope ytd-ticket-shelf-renderer">
                <td class="style-scope ytd-ticket-shelf-renderer">
                  <div class="when-date-column style-scope ytd-ticket-shelf-renderer">[[item.timeDate]]</div>
                </td>
                <td class="style-scope ytd-ticket-shelf-renderer">
                  <div class="when-weekday-column style-scope ytd-ticket-shelf-renderer">
                    <div class="style-scope ytd-ticket-shelf-renderer">
                      [[item.timeWeekday]]<span id="time" class="style-scope ytd-ticket-shelf-renderer">[[item.timeTime]]</span>
                    </div>
                  </div>
                </td>
                <td class="where-column-td style-scope ytd-ticket-shelf-renderer">
                  <div class="where-column style-scope ytd-ticket-shelf-renderer">
                    <div class="venue-vendor-container style-scope ytd-ticket-shelf-renderer">
                      <div class="venue style-scope ytd-ticket-shelf-renderer">[[item.subtitle2]]</div>
                      <b class="dot style-scope ytd-ticket-shelf-renderer">·</b>
                      <a class="vendor style-scope ytd-ticket-shelf-renderer" href="javascript:void(0)" id$="event-{{index}}">
                        [[item.linkText]]
                        <template is="dom-if" if="[[!item.hasMultipleOffers]]" class="style-scope ytd-ticket-shelf-renderer">
                          <yt-icon class="launch-icon style-scope ytd-ticket-shelf-renderer" icon="yt-icons:launch"></yt-icon>
                        </template>
                      </a>
                    </div>
                  </div>
                </td>
              </tr>
            </template>
          </table>
          <yt-icon-button id="shelf-toggler" hidden="[[!canShowMore]]" label="[[shelfTogglerLabelText]]" class="style-scope ytd-ticket-shelf-renderer">
            <yt-icon icon="[[shelfTogglerIcon]]" class="style-scope ytd-ticket-shelf-renderer"></yt-icon>
          </yt-icon-button>
        </div>
      </div>
    </div>
  </template>

  </dom-module>



