          <stop offset="0.2512" stop-color="#F64523" class="style-scope ytd-queue-to-play-state-renderer"></stop>
          <stop offset="0.4995" stop-color="#DE3334" class="style-scope ytd-queue-to-play-state-renderer"></stop>
