            <div id="description" class="style-scope ytd-queue-to-play-state-renderer">
              <template is="dom-repeat" items="[[data.sectionDescriptionMessages]]" class="style-scope ytd-queue-to-play-state-renderer">
                <yt-formatted-string text="[[item]]" class="style-scope ytd-queue-to-play-state-renderer"></yt-formatted-string>
