          </div>
        </div>
      </div>
  </template>
  </dom-module>

<dom-module id="ytd-recognition-shelf-renderer" assetpath="/ytd-recognition-shelf-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-recognition-shelf-renderer">
    
    <div id="wrapper" class="style-scope ytd-recognition-shelf-renderer">
      <div id="title-section" class="style-scope ytd-recognition-shelf-renderer">
        <div id="title-text" class="style-scope ytd-recognition-shelf-renderer">
          [[getSimpleString(data.rowTitle)]]
        </div>
      </div>
      <div id="recognition-section" class="style-scope ytd-recognition-shelf-renderer">
        <div id="avatars-section" class="style-scope ytd-recognition-shelf-renderer">
          <template is="dom-if" if="[[data.fixedAvatar]]" class="style-scope ytd-recognition-shelf-renderer">
            <yt-img-shadow id="fixed-avatar" class="avatar style-scope ytd-recognition-shelf-renderer" height="[[rowAvatarSize]]" thumbnail="[[data.fixedAvatar]]"></yt-img-shadow>
          </template>
          <div id="rows-section" class="style-scope ytd-recognition-shelf-renderer">
            <div id="hidden-section" class="style-scope ytd-recognition-shelf-renderer">
              <template is="dom-repeat" items="[[firstVisibleAvatarsList]]" class="style-scope ytd-recognition-shelf-renderer">
                <yt-img-shadow class="avatar style-scope ytd-recognition-shelf-renderer" height="[[rowAvatarSize]]" thumbnail="[[item]]"></yt-img-shadow>
              </template>
            </div>
            <div id="first-row-section" class="style-scope ytd-recognition-shelf-renderer">
              <template is="dom-repeat" items="[[firstVisibleAvatarsList]]" class="style-scope ytd-recognition-shelf-renderer">
                <yt-img-shadow class="avatar style-scope ytd-recognition-shelf-renderer" height="[[rowAvatarSize]]" thumbnail="[[item]]"></yt-img-shadow>
              </template>
            </div>
            <div id="second-row-section" class="style-scope ytd-recognition-shelf-renderer">
              <template is="dom-repeat" items="[[secondVisibleAvatarsList]]" class="style-scope ytd-recognition-shelf-renderer">
                <yt-img-shadow class="avatar style-scope ytd-recognition-shelf-renderer" height="[[rowAvatarSize]]" thumbnail="[[item]]"></yt-img-shadow>
              </template>
            </div>
          </div>
        </div>

        <template is="dom-if" if="[[hasCta]]" class="style-scope ytd-recognition-shelf-renderer">
          <div id="cta-section" class="style-scope ytd-recognition-shelf-renderer">
            <div id="cta-avatars" class="style-scope ytd-recognition-shelf-renderer">
              <template is="dom-repeat" items="[[ctaAvatarUrls]]" class="style-scope ytd-recognition-shelf-renderer">
                <img alt="" class="cta-avatar style-scope ytd-recognition-shelf-renderer" height="24" src$="[[item]]" width="24">
              </template>
            </div>
            <div id="cta-text-box" class="style-scope ytd-recognition-shelf-renderer">
              <div id="join-cta-text" class="style-scope ytd-recognition-shelf-renderer"><ytd-button-renderer data="[[data.joinButton.buttonRenderer]]" class="style-scope ytd-recognition-shelf-renderer"></ytd-button-renderer></div>
            </div>
          </div>
        </template>
      </div>
    </div>
  </template>
  </dom-module>

<dom-module id="ytd-unlimited-offer-module-renderer" assetpath="/ytd-unlimited-offer-module-renderer/" css-build="shady">
  
