<dom-module id="ytd-watch-next-secondary-results-renderer" assetpath="/ytd-watch-next-secondary-results-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-watch-next-secondary-results-renderer">
    
    <div id="offer-module" class="style-scope ytd-watch-next-secondary-results-renderer"></div>
    <div id="items" class="style-scope ytd-watch-next-secondary-results-renderer"></div>
