<dom-module id="ytd-watch-fixie" assetpath="/ytd-watch-fixie/" css-build="shady">
  
  <template css-build="shady" class="style-scope ytd-watch-fixie">
    
    <ytd-third-party-manager class="style-scope ytd-watch-fixie"></ytd-third-party-manager>
    <iron-media-query query="min-width: 1000px" query-matches="{{isTwoColumns_}}" class="style-scope ytd-watch-fixie">
    </iron-media-query>

    <div id="miniplayer-bar" class="style-scope ytd-watch-fixie"></div>

    <div id="player-theater-container" class="style-scope ytd-watch-fixie"></div>

    <div id="columns" class="style-scope ytd-watch-fixie">
      <div id="primary" class="style-scope ytd-watch-fixie">
        <div id="player-area" class="style-scope ytd-watch-fixie">
          <div id="player-outer" class="style-scope ytd-watch-fixie">
            <div id="player-container" role="complementary" class="style-scope ytd-watch-fixie">
              <ytd-player id="ytd-player" context="WEB_PLAYER_CONTEXT_CONFIG_ID_KEVLAR_WATCH" watch-next-data="[[data]]" class="style-scope ytd-watch-fixie"></ytd-player>
              <yt-playability-error-supported-renderers id="error-screen" data="[[playerData.playabilityStatus.errorScreen]]" disable-upgrade$="[[!playerUnavailable]]" hidden="[[!playerUnavailable]]" reason="[[playerData.playabilityStatus.reason]]" status="[[playerData.playabilityStatus.status]]" class="style-scope ytd-watch-fixie">
              </yt-playability-error-supported-renderers>
            </div>
          </div>
        </div>

        <div id="alerts" class="style-scope ytd-watch-fixie"></div>
        <div id="messages" class="style-scope ytd-watch-fixie"></div>

        <div id="metadata" class="style-scope ytd-watch-fixie">
          <div id="info" class="style-scope ytd-watch-fixie">
            <div id="info-skeleton" class="watch-skeleton style-scope ytd-watch-fixie"></div>
            <div id="info-contents" class="style-scope ytd-watch-fixie"></div>
          </div>
          <div id="meta" class="style-scope ytd-watch-fixie">
            <div id="meta-skeleton" class="watch-skeleton style-scope ytd-watch-fixie"></div>
            <div id="limited-state" class="style-scope ytd-watch-fixie"></div>
            <div id="meta-contents" class="style-scope ytd-watch-fixie"></div>
          </div>
        </div>
      </div>

      <div id="secondary" class="style-scope ytd-watch-fixie">
        <div id="secondary-scroll" class="style-scope ytd-watch-fixie">
          <div id="panels" class="style-scope ytd-watch-fixie"></div>
          <div id="clarify-box" class="style-scope ytd-watch-fixie"></div>
          <ytd-playlist-panel-renderer id="playlist" collapsible="" data="[[playlistData]]" disable-upgrade$="[[!playlist]]" fixie="" hidden="[[!playlist]]" loading$="[[loadingData.playlistLoading]]" class="style-scope ytd-watch-fixie">
          </ytd-playlist-panel-renderer>
          
          <div id="donation-shelf" class="style-scope ytd-watch-fixie"></div>
          <template is="dom-if" if="[[shouldStampChat]]" restamp="" id="chat-template" class="style-scope ytd-watch-fixie">
            <ytd-live-chat-frame id="chat" data="[[data.contents.twoColumnWatchNextResults.conversationBar]]" increased-min-height$="[[useLargerMinHeightForChat]]" class="style-scope ytd-watch-fixie">
            </ytd-live-chat-frame>
          </template>
          <div id="pla-shelf" class="style-scope ytd-watch-fixie">
            <ytd-pla-shelf-renderer active="[[plaShelfEnabled_]]" hidden="[[!plaShelfEnabled_]]" class="style-scope ytd-watch-fixie">
            </ytd-pla-shelf-renderer>
          </div>
          <div id="ticket-shelf" hidden="[[!monetizationShelvesEnabled_]]" class="style-scope ytd-watch-fixie"></div>
          <div id="merch-shelf" hidden="[[!merchandiseShelfEnabled_]]" class="style-scope ytd-watch-fixie"></div>
          <div id="related" class="style-scope ytd-watch-fixie">
            <div id="player-ads" class="style-scope ytd-watch-fixie"></div>
            <ytd-watch-next-secondary-results-renderer can-show-more="{{watchNextCanShowMore}}" data="[[data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" disable-upgrade$="[[!data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" hidden="[[!data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" shown-items="{{watchNextShownItems}}" class="style-scope ytd-watch-fixie">
            </ytd-watch-next-secondary-results-renderer>
            <div id="related-skeleton" class="watch-skeleton style-scope ytd-watch-fixie"></div>
          </div>
          <div id="comments-container" class="style-scope ytd-watch-fixie">
            <div id="comments-header" class="no-peeking style-scope ytd-watch-fixie" hidden="[[!showFixieCommentHeader_]]" on-tap="onCommentsExpandTap_">
              <div id="comments-header-top-row" class="style-scope ytd-watch-fixie">
                <yt-icon icon="yt-icons:comment" class="style-scope ytd-watch-fixie"></yt-icon>
                <div id="comments-header-text" class="style-scope ytd-watch-fixie">
                  <yt-formatted-string id="comments-header-title" text="[[comments.header.commentsHeaderRenderer.titleText]]" class="style-scope ytd-watch-fixie">
                  </yt-formatted-string>
                  <yt-formatted-string id="comments-header-count" text="[[comments.header.commentsHeaderRenderer.commentsCount]]" class="style-scope ytd-watch-fixie">
                  </yt-formatted-string>
                </div>
                
                <yt-icon-button class="style-scope ytd-watch-fixie">
                  <yt-icon id="comments-header-icon" icon="yt-icons:collapse" class="style-scope ytd-watch-fixie"></yt-icon>
                </yt-icon-button>
              </div>
              <div id="peeking-comment" hidden="" class="style-scope ytd-watch-fixie">
                <ytd-comment-renderer data="[[peekingCommentData_]]" no-actions="" class="style-scope ytd-watch-fixie">
                </ytd-comment-renderer>
              </div>
            </div>
            <ytd-comments id="comments" can-schedule-jobs="[[canScheduleCommentJobs_]]" data="[[comments]]" disable-upgrade$="[[!computeShowComments_(comments, canShowComments_, shouldStampChat)]]" hidden="[[!computeShowComments_(comments, canShowComments_, shouldStampChat)]]" class="style-scope ytd-watch-fixie">
            </ytd-comments>
          </div>
        </div>
      </div>
    </div>

    <ytd-video-quality-promo-renderer id="speedyg" data="[[speedyGData_.videoQualityPromoRenderer]]" disable-upgrade$="[[!speedyGData_]]" hidden="[[!speedyGData_]]" class="style-scope ytd-watch-fixie">
    </ytd-video-quality-promo-renderer>

    <div id="survey" class="style-scope ytd-watch-fixie"></div>
  </template>
  </dom-module>

<dom-module id="yt-live-chat-poll-choice" assetpath="/yt-live-chat-poll-choice/" css-build="shady">
  
