    <iron-media-query id="large-window-query" query-matches="{{flexyLargeWindow_}}" class="style-scope ytd-watch-flexy">
    </iron-media-query>

    <div id="microformat" class="style-scope ytd-watch-flexy"></div>

    <div id="miniplayer-bar" class="style-scope ytd-watch-flexy"></div>

    <div id="player-theater-container" class="style-scope ytd-watch-flexy"></div>

    <div id="columns" class="style-scope ytd-watch-flexy">
