                  </ytd-player>
                </div>
              </div>
            </div>
            <yt-playability-error-supported-renderers id="error-screen" data="[[playerData.playabilityStatus.errorScreen]]" disable-upgrade$="[[!playerUnavailable]]" hidden="[[!playerUnavailable]]" reason="[[playerData.playabilityStatus.reason]]" status="[[playerData.playabilityStatus.status]]" class="style-scope ytd-watch-flexy">
            </yt-playability-error-supported-renderers>
          </div>
          <div id="alerts" class="style-scope ytd-watch-flexy"></div>
          <div id="messages" class="style-scope ytd-watch-flexy"></div>
          <div id="clarify-box" class="style-scope ytd-watch-flexy"></div>
          <div id="info" class="style-scope ytd-watch-flexy">
            <div id="info-skeleton" class="watch-skeleton style-scope ytd-watch-flexy"></div>
            <div id="info-contents" class="style-scope ytd-watch-flexy"></div>
          </div>
          <div id="pla-shelf" class="style-scope ytd-watch-flexy">
            <ytd-pla-shelf-renderer active="[[plaShelfEnabled_]]" hidden="[[!plaShelfEnabled_]]" class="style-scope ytd-watch-flexy">
            </ytd-pla-shelf-renderer>
          </div>
          <div id="meta" class="style-scope ytd-watch-flexy">
            <div id="meta-skeleton" class="watch-skeleton style-scope ytd-watch-flexy"></div>
            <div id="limited-state" class="style-scope ytd-watch-flexy"></div>
            <div id="meta-contents" class="style-scope ytd-watch-flexy"></div>
          </div>
          <div id="ticket-shelf" hidden="[[!monetizationShelvesEnabled_]]" class="style-scope ytd-watch-flexy"></div>
          <div id="merch-shelf" hidden="[[!merchandiseShelfEnabled_]]" class="style-scope ytd-watch-flexy"></div>
          <ytd-comments id="comments" can-schedule-jobs="[[canScheduleCommentJobs_]]" data="[[comments]]" disable-upgrade$="[[!computeShowComments_(comments, canShowComments_, shouldStampChat)]]" hidden="[[!computeShowComments_(comments, canShowComments_, shouldStampChat)]]" class="style-scope ytd-watch-flexy">
          </ytd-comments>
        </div>
      </div>

      <div id="secondary" class="style-scope ytd-watch-flexy">
        <div id="secondary-inner" class="style-scope ytd-watch-flexy">
          <div id="panels" class="style-scope ytd-watch-flexy"></div>
          <ytd-playlist-panel-renderer id="playlist" data="[[playlistData]]" disable-upgrade$="[[!playlist]]" hidden="[[!playlist]]" loading$="[[loadingData.playlistLoading]]" class="style-scope ytd-watch-flexy">
          </ytd-playlist-panel-renderer>
          <div id="donation-shelf" class="style-scope ytd-watch-flexy"></div>
          
          <template is="dom-if" if="[[shouldStampNativeChat]]" class="style-scope ytd-watch-flexy">
            <div id="chat" class="style-scope ytd-watch-flexy">
              
              <yt-payments-manager class="style-scope ytd-watch-flexy"></yt-payments-manager>
              
              <yt-native-buyflow-launcher class="style-scope ytd-watch-flexy"></yt-native-buyflow-launcher>
              <yt-live-chat-renderer data="[[data.contents.twoColumnWatchNextResults.conversationBar.liveChatRenderer]]" class="style-scope ytd-watch-flexy">
              </yt-live-chat-renderer>
              <template is="dom-if" if="[[data.contents.twoColumnWatchNextResults.conversationBarRenderer.availabilityMessage]]" class="style-scope ytd-watch-flexy">
                <ytd-message-renderer data="[[data.conversationBarRenderer.availabilityMessage.messageRenderer]]" class="style-scope ytd-watch-flexy">
                </ytd-message-renderer>
              </template>
            </div>
            <div id="show-hide-button" class="style-scope ytd-watch-flexy">
              <ytd-toggle-button-renderer data="[[data.contents.twoColumnWatchNextResults.conversationBar.liveChatRenderer.showHideButton.toggleButtonRenderer]]" class="style-scope ytd-watch-flexy">
              </ytd-toggle-button-renderer>
            </div>
          </template>
          
          <template is="dom-if" if="[[shouldStampChat]]" restamp="" id="chat-template" class="style-scope ytd-watch-flexy">
            <ytd-live-chat-frame id="chat" data="[[data.contents.twoColumnWatchNextResults.conversationBar]]" increased-min-height$="[[useLargerMinHeightForChat]]" class="style-scope ytd-watch-flexy">
            </ytd-live-chat-frame>
          </template>
          <div id="related" class="style-scope ytd-watch-flexy">
            <div id="player-ads" class="style-scope ytd-watch-flexy"></div>
            <ytd-watch-next-secondary-results-renderer autonav-disabled="[[autonavDisabled_]]" can-show-more="{{watchNextCanShowMore}}" data="[[data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" disable-upgrade$="[[!data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" hidden="[[!data.contents.twoColumnWatchNextResults.secondaryResults.secondaryResults]]" hide-autoplay="[[hideAutoplay_]]" is-two-columns="[[isTwoColumns_]]" player-data="[[playerData]]" playlist="[[playlist]]" show-more-button="[[!isTwoColumns_]]" shown-items="{{watchNextShownItems}}" class="style-scope ytd-watch-flexy">
            </ytd-watch-next-secondary-results-renderer>
            <div id="related-skeleton" class="watch-skeleton style-scope ytd-watch-flexy"></div>
          </div>
        </div>
      </div>
    </div>

    <ytd-video-quality-promo-renderer id="speedyg" data="[[speedyGData_.videoQualityPromoRenderer]]" disable-upgrade$="[[!speedyGData_]]" hidden="[[!speedyGData_]]" class="style-scope ytd-watch-flexy">
