<dom-module id="yt-options-renderer" assetpath="/yt-options-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-options-renderer">
    
    <div id="options-select" class="style-scope yt-options-renderer">
      <paper-radio-group id="yt-options-renderer-options" selected="{{itemSelected_}}" on-iron-select="onTopItemSelected_" class="style-scope yt-options-renderer">
        <template is="dom-repeat" items="[[data.items]]" class="style-scope yt-options-renderer">
          <paper-radio-button class="radio style-scope yt-options-renderer" aria-label$="[[item.optionSelectableItemRenderer.accessibility.accessibilityData.label]]" name$="[[index]]" value="[[item.optionSelectableItemRenderer]]">
            <div class="content style-scope yt-options-renderer">
              <yt-formatted-string text="[[item.optionSelectableItemRenderer.text]]" class="style-scope yt-options-renderer">
              </yt-formatted-string>
              <template is="dom-if" if="[[item.optionSelectableItemRenderer.accessibility.accessibilityData.label]]" class="style-scope yt-options-renderer">
                <div class="info-container style-scope yt-options-renderer" on-tap="preventSelection_">
                  <yt-icon icon="yt-icons:help_outline" class="style-scope yt-options-renderer"></yt-icon>
                  <paper-tooltip animation-delay="[[animationDelay]]" class="style-scope yt-options-renderer">
                    [[item.optionSelectableItemRenderer.accessibility.accessibilityData.label]]
                  </paper-tooltip>
                </div>
              </template>
            </div>
          </paper-radio-button>
          <template is="dom-if" if="[[item.optionSelectableItemRenderer.subOptions]]" class="style-scope yt-options-renderer">
            <paper-dropdown-menu aria-label$="[[item.optionSelectableItemRenderer.subOptionsAccessibility.label]]" hidden="[[isSubReasonHidden_(index, itemSelected_)]]" no-label-float="" restore-focus-on-close="[[restoreFocusOnClose_]]" on-iron-select="onItemSelected_" class="style-scope yt-options-renderer">
              <paper-listbox class="dropdown-content style-scope yt-options-renderer" slot="dropdown-content">
                <template is="dom-repeat" items="[[item.optionSelectableItemRenderer.subOptions]]" as="subOption" class="style-scope yt-options-renderer">
                  <paper-item value="[[getItem_(subOption)]]" class="style-scope yt-options-renderer">
                    [[computeText_(subOption)]]
                  </paper-item>
                </template>
             </paper-listbox>
            </paper-dropdown-menu>
          </template>
        </template>
      </paper-radio-group>
    </div>
  </template>
  </dom-module>

