<dom-module id="yt-sharing-renderer" assetpath="/yt-sharing-renderer/" css-build="shady">
  
  <template css-build="shady" class="style-scope yt-sharing-renderer">
    
    <div id="share-label" class="style-scope yt-sharing-renderer">[[menuStrings_.SHARE_LABEL]]</div>
    <div id="share-target-wrapper" class="style-scope yt-sharing-renderer">
      <template is="dom-repeat" items="[[data.sharingRenderer.primaryShareTargets]]" class="style-scope yt-sharing-renderer">
        <a class="share-target yt-simple-endpoint style-scope yt-sharing-renderer" href$="[[computeHref_(item.shareTargetRenderer.navigationEndpoint)]]" data="[[item.shareTargetRenderer.navigationEndpoint]]" target="_blank" title="[[getSimpleString(item.shareTargetRenderer.title)]]">
          <yt-icon class="icon-resize style-scope yt-sharing-renderer" icon="[[getIconName_(item.shareTargetRenderer.serviceName)]]">
          </yt-icon>
        </a>
      </template>
      <template is="dom-repeat" items="[[data.sharingRenderer.secondaryShareTargets]]" class="style-scope yt-sharing-renderer">
        <a class="yt-simple-endpoint style-scope yt-sharing-renderer" href$="[[computeHref_(item.shareTargetRenderer.navigationEndpoint)]]" data="[[item.shareTargetRenderer.navigationEndpoint]]" target="_blank" title="[[getSimpleString(item.shareTargetRenderer.title)]]">
          <yt-icon class="icon-resize style-scope yt-sharing-renderer" icon="[[getIconName_(item.shareTargetRenderer.serviceName)]]">
          </yt-icon>
        </a>
      </template>
      <a id="email" target="_blank" href$="[[emailTarget_]]" title="email" class="style-scope yt-sharing-renderer">
        <yt-icon class="icon-resize style-scope yt-sharing-renderer" icon="yt-icons:email"></yt-icon>
      </a>
    </div>
    <paper-input id="share-url" autofocus="" label="[[getSimpleString(data.sharingRenderer.title)]]" no-label-float="" readonly="" use-v2-underline="" value="{{shareUrl_}}" class="style-scope yt-sharing-renderer">
    </paper-input>
    <div id="start-at-wrapper" class="style-scope yt-sharing-renderer">
      <paper-checkbox id="start-at-option" checked="{{startAtChecked_}}" on-change="onStartAtChange_" class="style-scope yt-sharing-renderer">
        <yt-formatted-string text="[[data.sharingRenderer.startAt.startAtRenderer.startAtOptionLabel]]" class="style-scope yt-sharing-renderer">
        </yt-formatted-string>
      </paper-checkbox>
      <paper-input id="start-at-timestamp" disabled="" no-label-float="" use-v2-underline="" value="{{startAtTimeStamp_}}" on-blur="onStartAtTimeStampChanged_" on-change="startAtChecked_" class="style-scope yt-sharing-renderer">
        </paper-input>
    </div>
    <div id="action-buttons" class="style-scope yt-sharing-renderer"></div>
  </template>
  </dom-module>


